description:
My GospelKeys 202 *Special Edition* Series video course (5 hours) will teach you everything you need to know to play just about any worship song you can think of. I won't spend time showing you EACH AND EVERY slow worship song. Rather, I will spend time showing you the basic rules that'll allow you to MASTER hundreds of songs. Yes, I will cover several songs in the video but these are meant to show you EXACTLY how to play all the other songs that follow these same patterns and &quot;couples&quot;. 
